import React from "react";
import styled from "styled-components";

const StyledCard = styled.div`
  width: 400px;
  height: 300px;
  padding: 2rem;
  background-color: white;
`;

export const QuestionCard: React.FC<{ question: Question }> = ({
  question
}) => {
  return (
    <StyledCard>
      <h4>QUESTION</h4>
    </StyledCard>
  );
};
